import { useLocation } from "react-router-dom";
import "./Header.scss";

const Header: React.FC = () => {
  const location = useLocation();
  return (
    <div>
      <div className="header-container">
        <div></div>
        {location.pathname === "/" && <p className="header-text">Dashboard</p>}
      </div>
    </div>
  );
};

export default Header;
